  }

  render() {
    return (
      <div className="App">
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onSubmit={this.onSubmit} />
        {/*

        <FaceRecognition />*/}
      </div>
    );
  }
}

export default App;
